import React from 'react';
import { Loader2, Heart, ShoppingCart, Eye, Sparkles, Info } from 'lucide-react';

const RingPreview = ({ imageUrl, loading, description }) => {
  return (
    <div className="w-full">
      <h3 className="text-lg font-semibold text-gray-900 mb-3 flex items-center">
        <Eye className="w-5 h-5 mr-2 text-blue-600" />
        Ring Preview
      </h3>
      
      {/* Image Container */}
      <div className="relative aspect-square bg-gradient-to-br from-slate-50 to-blue-50 rounded-xl overflow-hidden mb-4 border border-gray-100 shadow-inner">
        {loading ? (
          <div className="absolute inset-0 flex items-center justify-center">
            <div className="text-center">
              <Loader2 className="animate-spin h-8 w-8 text-blue-500 mx-auto mb-2" />
              <p className="text-sm text-gray-600">Loading ring image...</p>
            </div>
          </div>
        ) : imageUrl ? (
          <img
            src={imageUrl}
            alt="Ring Preview"
            className="w-full h-full object-contain p-4"
            onError={(e) => {
              e.target.src = '/placeholder-ring.png';
            }}
          />
        ) : (
          <div className="absolute inset-0 flex items-center justify-center">
            <div className="text-center p-6">
              <div className="w-20 h-20 bg-gradient-to-br from-blue-100 to-purple-100 rounded-full mx-auto mb-3 flex items-center justify-center">
                <Sparkles className="w-8 h-8 text-blue-400" />
              </div>
              <p className="text-gray-600 font-medium">No ring selected</p>
              <p className="text-xs text-gray-400 mt-1">Start customizing to see your ring</p>
            </div>
          </div>
        )}
      </div>

      {/* Description */}
      <div className="bg-gradient-to-r from-blue-50 to-indigo-50 rounded-lg p-3 border border-blue-100">
        <h4 className="font-medium text-gray-900 mb-1 text-sm">Current Selection</h4>
        <p className="text-gray-600 text-xs leading-relaxed">
          {description || 'Begin by selecting your metal type to see your ring preview'}
        </p>
      </div>

      {/* Instructions */}
      <div className="mt-3 p-3 bg-gradient-to-r from-amber-50 to-orange-50 border border-amber-200 rounded-lg">
        <h4 className="font-medium text-amber-900 mb-2 text-sm flex items-center">
          <Info className="w-4 h-4 mr-1" />
          How it works
        </h4>
        <ul className="text-xs text-amber-800 space-y-1">
          <li className="flex items-center">
            <div className="w-1.5 h-1.5 bg-amber-500 rounded-full mr-2"></div>
            Select metal to see the basic ring band
          </li>
          <li className="flex items-center">
            <div className="w-1.5 h-1.5 bg-amber-500 rounded-full mr-2"></div>
            Choose design to see the ring style
          </li>
          <li className="flex items-center">
            <div className="w-1.5 h-1.5 bg-amber-500 rounded-full mr-2"></div>
            Pick diamond shape to see the setting
          </li>
          <li className="flex items-center">
            <div className="w-1.5 h-1.5 bg-amber-500 rounded-full mr-2"></div>
            Select carat weight for the final ring
          </li>
        </ul>
      </div>

      {/* Image Path Info - Only show in development */}
      {imageUrl && !loading && process.env.NODE_ENV === 'development' && (
        <div className="mt-3 p-2 bg-gray-50 border border-gray-200 rounded-lg">
          <h4 className="font-medium text-gray-900 mb-1 text-xs">Image Path</h4>
          <p className="text-xs text-gray-600 font-mono break-all">
            {imageUrl.includes('placeholder') ? 'Using placeholder image' : imageUrl}
          </p>
        </div>
      )}
    </div>
  );
};

export default RingPreview;
